import React, {useState} from 'react';
import CurrencyList, {IsList} from './CurrencyList';
import History, {IsHistory} from './Hystory';

import Convert from './Convert';

export default function Navbar() {
    const [isHiddenConvert, setIsHiddeConvertn] = useState(false)
    return (
        <div>
            <button disabled={true}>Converter</button>
            <button onClick={() => setIsHidden(s => !s)}>CurrencyList</button>
            <button>History</button>
            <Convert />
            {!isHiddenConvert && IsList ? <CurrencyList/> : null} 
        </div>
    )
}
